import './App.css';

import React, { Component } from 'react'
import Navbar from './components/Navbar';
import News from './components/News';

import {
  BrowserRouter as Router,
  Routes,
  Route
} from 'react-router-dom';

export default class App extends Component {
  render() {
    return (
      <>
        <Navbar />
        <Routes>
          <Route path="/science" element={<News pageSize={12} apiKey="fcebedeebdc14a58a6affb01a5fd595b" country="in" category="science" />} />
          <Route path="/business" element={<News pageSize={12} apiKey="fcebedeebdc14a58a6affb01a5fd595b" country="in" category="business" />} />
          <Route path="/entertainment" element={<News pageSize={12} apiKey="fcebedeebdc14a58a6affb01a5fd595b" country="in" category="entertainment" />} />
          <Route path="/health" element={<News pageSize={12} apiKey="fcebedeebdc14a58a6affb01a5fd595b" country="in" category="health" />} />
          <Route path="/sports" element={<News pageSize={12} apiKey="fcebedeebdc14a58a6affb01a5fd595b" country="in" category="sports" />} />
          <Route path="/technology" element={<News pageSize={12} apiKey="fcebedeebdc14a58a6affb01a5fd595b" country="in" category="technology" />} />
        </Routes>
      </>
    )
  }
}
